            <div className="flex items-center space-x-3">
              <div className="bg-success-green/20 p-2 rounded-lg">
                <FileImage className="h-5 w-5 text-success-green" />
              </div>
              <div>
                <p className="font-medium text-success-green">
                  Dosya ba≈üarƒ±yla y√ºklendi
                </p>
                <p className="text-sm text-gray-600">
                  {uploadedFile.name} ({(uploadedFile.size / (1024 * 1024)).toFixed(2)} MB)
                </p>
              </div>
            </div>
            <button
              onClick={removeFile}
              className="p-1 hover:bg-gray-100 rounded-full transition-colors"
            >
              <X className="h-4 w-4 text-gray-500" />
            </button>
          </div>
        </div>

        {/* Upload Another File */}
        <div
          {...getRootProps()}
          className={`
            dropzone cursor-pointer
            ${isDragActive ? 'active' : ''}
          `}
        >
          <input {...getInputProps()} />
          <Upload className="h-8 w-8 text-gray-400 mx-auto mb-3" />
          <p className="text-gray-600 font-medium">
            Farklƒ± bir dosya y√ºklemek i√ßin tƒ±klayƒ±n
          </p>
          <p className="text-sm text-gray-500 mt-1">
            veya dosyayƒ± buraya s√ºr√ºkleyin
