  }

  return (
    <div className="space-y-4">
      {/* Main Dropzone */}
      <div
        {...getRootProps()}
        className={`
          dropzone cursor-pointer
          ${isDragActive ? 'active' : ''}
        `}
      >
        <input {...getInputProps()} />

        <div className="text-center">
          <Upload className="h-12 w-12 text-gray-400 mx-auto mb-4" />

          {isDragActive ? (
            <div>
              <p className="text-lg font-medium text-xray-blue">
                Dosyayƒ± buraya bƒ±rakƒ±n
              </p>
              <p className="text-sm text-gray-600 mt-1">
                Ekran g√∂r√ºnt√ºs√º analiz edilecek
              </p>
            </div>
          ) : (
            <div>
              <p className="text-lg font-medium text-gray-700 mb-2">
                Ekran g√∂r√ºnt√ºs√ºn√º y√ºkleyin
              </p>
              <p className="text-gray-600 mb-4">
                Test edilecek UI'ƒ±n ekran g√∂r√ºnt√ºs√ºn√º s√ºr√ºkleyip bƒ±rakƒ±n
                <br />
                veya dosya se√ßmek i√ßin tƒ±klayƒ±n
              </p>
              <div className="inline-flex items-center px-4 py-2 bg-xray-blue text-white rounded-lg hover:bg-blue-700 transition-colors">
                <Image className="h-4 w-4 mr-2" />
                Dosya Se√ß
              </div>
            </div>
          )}
        </div>
      </div>

      {/* File Format Info */}
      <div className="bg-gray-50 rounded-lg p-4">
        <h4 className="font-medium text-gray-900 mb-2">üìã Desteklenen Formatlar</h4>
        <div className="flex flex-wrap gap-2">
          {['PNG', 'JPG', 'JPEG', 'GIF', 'BMP', 'WEBP'].map(format => (
            <span 
              key={format}
              className="px-2 py-1 bg-white border border-gray-200 rounded text-xs font-medium text-gray-600"
            >
              {format}
            </span>
          ))}
        </div>
        <p className="text-xs text-gray-500 mt-2">
          Maksimum dosya boyutu: 10MB
        </p>
      </div>

      {/* Tips */}
      <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
        <h4 className="font-medium text-blue-900 mb-2">üí° ƒ∞pu√ßlarƒ±</h4>
        <ul className="text-sm text-blue-800 space-y-1">
          <li>‚Ä¢ Y√ºksek √ß√∂z√ºn√ºrl√ºkl√º ekran g√∂r√ºnt√ºleri daha iyi sonu√ß verir</li>
